def libvirt_error_handler(ctx, error):
    '''
    Redirect stderr prints from libvirt to salt logging.
    '''
    try:
        # Redirect libvirt errors to salt logging
        salt.log.warning('Libvirt error: %s' % error)
    except Exception as e:
        salt.log.error('Error handling libvirt error: %s' % e)

